import React from 'react'
import './NavBar.css'

interface NavBarProps {
    renderLinks: JSX.Element[]
}

const NavBar: React.FC<NavBarProps> = props => {
    return (
        <div id='NavBar'>
            <h1 className='title'>Lynette's Skin Studio</h1>
            <ul className='remove-ul-link'>
                { props.renderLinks }
            </ul>
        </div>
    )
}

export default NavBar
